	('nzukoor_cachetribediscussions45','a:3:{s:4:\"data\";a:2:{i:0;a:15:{s:2:\"id\";i:95;s:4:\"name\";s:35:\"Roadmap to becoming a Web Developer\";s:8:\"category\";a:5:{s:5:\"value\";s:10:\"Technology\";s:4:\"icon\";s:3:\"cpu\";s:2:\"id\";i:3;s:5:\"color\";s:7:\"#347C2C\";s:5:\"image\";s:12:\"/img/six.png\";}s:11:\"description\";s:255:\"Over the years I have had friends disturbing me to help them learn to code and even after I give them directions it still always becomes a herculean task and they end up losing interest. So today I will be breaking it down step by step, follow along guys.\";s:4:\"type\";s:6:\"public\";s:12:\"commentCount\";i:1;s:17:\"discussionmessage\";a:1:{i:0;a:14:{s:2:\"id\";i:145;s:7:\"message\";s:498:\"<p><strong>Who is a web developer?</strong></p>\n<p>According to google, A web developer is a programmer who specializes in or is specifically engaged in, the development of World Wide Web applications using a client-server model.</p>\n<p>Yes I know some of these terms may not sit well with your brains..lol but don\'t worry I will be explaining everything as we go along. This will be like a series, and I will be dropping new episodes every day, so try not to miss any guys . Stay Tuned ...haha</p>\";s:10:\"attachment\";N;s:8:\"admin_id\";N;s:7:\"user_id\";i:305;s:14:\"facilitator_id\";N;s:13:\"discussion_id\";i:95;s:15:\"organization_id\";i:1;s:10:\"created_at\";s:27:\"2021-09-06T09:23:53.000000Z\";s:10:\"updated_at\";s:27:\"2021-09-06T09:23:53.000000Z\";s:8:\"publicId\";N;s:4:\"user\";a:25:{s:2:\"id\";i:305;s:4:\"name\";s:17:\"Success Arudovwen\";s:5:\"email\";s:19:\"succy2010@gmail.com\";s:17:\"email_verified_at\";N;s:10:\"created_at\";s:27:\"2021-08-17T16:13:33.000000Z\";s:10:\"updated_at\";s:27:\"2021-08-18T13:39:27.000000Z\";s:5:\"phone\";s:11:\"08160723910\";s:7:\"address\";N;s:3:\"bio\";N;s:7:\"profile\";s:95:\"https://res.cloudinary.com/skillsguruh/image/upload/v1629216793/SAVE_20210608_152859_btpsjl.jpg\";s:12:\"verification\";b:1;s:13:\"ref