INSERT INTO `course_outlines` (`id`, `knowledge_areas`, `modules`, `duration`, `certification`, `faqs`, `overview`, `additional_info`, `course_id`, `organization_id`, `created_at`, `updated_at`)
VALUES
	(124,'{\"value\":\"Entrepreneurship\",\"icon\":\"card-heading\",\"color\":\"#3C565B\"}','[{\"fixed\":false,\"module\":\"Worksheet Guide\"},{\"fixed\":false,\"module\":\"Getting to know me\"},{\"fixed\":false,\"module\":\"The people in my life\"},{\"fixed\":false,\"module\":\"The road ahead\"}]','2 Weeks','no','[{\"question\":\"How much do I need to pay?\",\"answer\":\"This is a community course, meaning that you do not need to pay for access, you only need to invite your friends to take the course with you. The more the merrier!\"},{\"question\":\"What does group access mean?\",\"answer\":\"Group access means that you do not have to pay to access the course, but you can access it as a group of the required number of users\"}]','<p>While growing a business is awesome, do you know what&rsquo;s even better? Being at peace with who you really are while doing so; this is why we start right here at discovering what is within. Once completed, you will be empowered with renewed self- awareness and voice, so that you will be led to tell your own story through your entrepreneurial journey; the products and services that you develop to serve humanity.</p>\n<p>Finally, you will be able to develop and deploy strategies that best align your resources and capabilities to the requirements of your business operating environment and vision.</p>',NULL,144,74,'2021-07-05 10:38:33','2021-07-29 09:07:55'),
	(154,'{\"value\":\"Entrepreneurship\",\"icon\":\"card-heading\",\"color\":\"#3C565B\"}','[{\"fixed\":false,\"module\":\"My Bright Idea\"},{\"fixed\":false,\"module\":\"My Business Vision\"},{\"fixed\":false,\"module\":\"My Business Mission\"},{\"fixed\":false,\"module\":\"My Business Values\"}]','2 Weeks','no','[{\"question\":\"What does group access mean?\",\"answer\":\"Group access means that you do not have to pay to access the course, but you can access it as a group of the required number of users\"}]','<p>All entrepreneurs are inspired&mdash; by an idea, a person or an opportunity. That inspiration not only gets you started; it also keeps you going.What inspired this business idea? What excites you about your business idea? If you have two or three ideas, what do you like best about each one? Where did the idea come from? How has it evolved since you started the process of turning the idea into a business??&nbsp;</p>\n<p >By looking at how you initially got inspiration for your business, you can take the next step toward determining how you might get others excited about your business as well. You will find it useful to have a record of what initially inspired you, to which you can refer from time to time, especially as your business grows.</p>',NULL,174,74,'2021-07-19 12:35:33','2021-07-29 09:07:41'),
	(234,'{\"value\":\"Entrepreneurship\",\"color\":\"#3C565B\",\"icon\":\"card-heading\"}','[{\"fixed\":false,\"module\":\"My Business Overview\"},{\"fixed\":false,\"module\":\"My Customer Segments\"},{\"fixed\":false,\"module\":\"My Unique Value Proposition\"}]','2 Weeks','no','[{\"question\":\"What does group access mean?\",\"answer\":\"Group access means that you do not have to pay to access the course, but you can access it as a group of the required number of users\"}]','<p >OK, so you have your inspiration, and you&rsquo;ve seen an opportunity in the market. . . now how do those translate into your particular business concept? Exactly what are you going to sell? To whom? How?<span >&nbsp;</span></p>\n<p\n>&nbsp;</p>\n<p >Meeting needs is the basis of all business. You can devise a wonderful new machine, but if it doesn&rsquo;t address some real and important need or desire, people won&rsquo;t buy it, and your business will fail.<span>&nbsp;</span></p>',NULL,254,74,'2021-07-28 13:50:14','2021-07-29 09:07:16'),
	(274,'{\"value\":\"Marketing\",\"color\":\"#8A2BE2\",\"icon\":\"basket-fill\"}','[{\"fixed\":false,\"module\":\"Marketing plan guide\"},{\"fixed\":false,\"module\":\"Defining your target market\"},{\"fixed\":false,\"module\":\"Your situation analysis (SWOT)\"},{\"fixed\":false,\"module\":\"Your industry analysis (Competitor)\"},{\"fixed\":false,\"module\":\"Defining your market goals\"},{\"fixed\":false,\"module\":\"Defining your marketing mix\"}]','2 weeks','no','[{\"question\":\"What is the enrollment fee\",\"answer\":\"None at all, just invite your frinds\"}]','<p>Even if you think you&rsquo;ll market directly to consumers online, you will soon discover that there are still many entities between you and your customer. Give yourself a competitive edge by thinking of each of these customers and plan for their needs and motivation.</p>\n<p>This course employs a number of frameworks to answer questions that sharpen your understanding of your marketplace so that you can make the most of your marketing investments and achieve results.</p>',NULL,394,74,'2021-07-29 10:30:46','2021-07-30 19:42:58');
