INSERT INTO `discussion_messages` (`id`, `message`, `attachment`, `admin_id`, `user_id`, `facilitator_id`, `discussion_id`, `organization_id`, `created_at`, `updated_at`, `publicId`)
VALUES
	(75,'<p>Not an answer to your question, but I have the same of issue of quieting my mind. &nbsp;I\'m looking forward to answers to your question.&nbsp;</p>',NULL,NULL,615,NULL,45,1,'2021-08-19 14:42:55','2021-08-19 14:42:55',NULL),
	(85,'<p>Good question @Luchibee. Morning meditation and meditation in any form is good for mind, body and soul. Asking to quiet the mind is like trying to use a bucket to catch a waterfall. You can\'t stop it.&nbsp;<br /><br /></p>\n<p>So the first step is to acknowledge that the mind does its own thing. You cannot quiet it in that way. The next step is to observe the movement of thoughts without judgement. And the final step is to commit to a daily practice. It gets better with each practice.&nbsp;<br /><br /></p>\n<p>P.S. don\'t beat yourself up when it seems the mind is not quieting as you\'\'ll want. It is the time spent meditating that matters. Practice will take care of the rest&nbsp;</p>',NULL,NULL,625,NULL,45,1,'2021-08-19 16:29:41','2021-08-19 16:29:41',NULL),
	(95,'<p>In an ideal world, I\'d love to be a gym rat in every sense, have access to professional equipment and coaching, as well as community, but with the proximity to the gyms I actually like and the way my schedule is currently set up, I have resorted to home work out.&nbsp;<br /><br /></p>\n<p>I think with both it\'s really down to discipline and consistency.&nbsp;</p>',NULL,NULL,235,NULL,65,1,'2021-08-19 20:25:47','2021-08-19 20:25:47',NULL),
	(105,'<p>Nobody told me I was going to lose my hair. Yes it\'s superficial but my hair is falling off from the root. I have many more to share, but this for now lol</p>',NULL,NULL,585,NULL,55,1,'2021-08-19 22:50:43','2021-08-19 22:50:43',NULL),
	(115,'<p>I have an app that helps me to meditate. There are different settings and you can select however long you would like to meditate for. Personally, I feel that as long as you can eliminate distractions, which the app helps you to do, it does help to keep you calm and focused and avoid being overwhelmed!</p>',NULL,NULL,515,NULL,45,1,'2021-08-20 15:18:28','2021-08-20 15:18:28',NULL),
	(125,'<p>You can focus the mind but I don\'t really know about quieting the mind&nbsp;</p>',NULL,NULL,665,NULL,45,1,'2021-08-21 20:27:24','2021-08-21 20:27:24',NULL),
	(135,'<p>This is something that\'s bound to be very difficult if it\'s physical meetings because most like to be indoors , except it\'s an Hackathon or a Tech conference, you\'d hardly see any outside ,unless the cool ones like me.. lol&nbsp;</p>',NULL,NULL,305,NULL,85,1,'2021-09-01 12:57:35','2021-09-01 12:57:35',NULL),
	(145,'<p><strong>Who is a web developer?</strong></p>\n<p>According to google, A web developer is a programmer who specializes in or is specifically engaged in, the development of World Wide Web applications using a client-server model.</p>\n<p>Yes I know some of these terms may not sit well with your brains..lol but don\'t worry I will be explaining everything as we go along. This will be like a series, and I will be dropping new episodes every day, so try not to miss any guys . Stay Tuned ...haha</p>',NULL,NULL,305,NULL,95,1,'2021-09-06 09:23:53','2021-09-06 09:23:53',NULL);
