INSERT INTO `discussions` (`id`, `name`, `type`, `creator`, `description`, `tags`, `user_id`, `facilitator_id`, `admin_id`, `course_id`, `organization_id`, `created_at`, `updated_at`, `category`, `tribe_id`)
VALUES
	(34,'How to become a fullstack developer','public','admin','A full stack developer is an engineer who can handle all the work of databases, servers, systems engineering, and clients. As one of the hottest topics for developers, the discussions have never stopped. On LinkedIn and Facebook, lots of people put their job title as a full stack developer.','[{\"value\":\"Tech\",\"icon\":\"cpu\",\"color\":\"#347C2C\"}]',NULL,NULL,64,NULL,104,'2021-07-25 14:19:04','2021-07-25 14:19:04','{\"value\":\"Entrepreneurship\",\"icon\":\"card-heading\",\"id\":1,\"color\":\"#3C565B\",\"image\":\"\\/img\\/nine.png\"}',NULL),
	(44,'Javascript Functions','public','admin','A function in JavaScript is similar to a procedure—a set of statements that performs a task or calculates a value, but for a procedure to qualify as a function, it should take some input and return an output where there is some obvious relationship between the input and the output.','[{\"value\":\"Tech\",\"icon\":\"cpu\",\"color\":\"#347C2C\"}]',NULL,NULL,64,NULL,104,'2021-07-25 14:20:08','2021-07-25 14:20:08','{\"value\":\"Career Development\",\"icon\":\"ladder\",\"id\":2,\"color\":\"#0000A5\",\"image\":\"\\/img\\/eight.png\"}',NULL),
	(45,'Does 30-min daily morning meditation really work?','public','user','So much has been said for morning meditations, I\'m really curious to know if anyone has tried it and if they really work. Personally, I find that I cannot quiet my mind for more than 30 seconds.  Any hacks please?','[{\"id\":2,\"value\":\"Mental Health\",\"icon\":\"diagram2-fill\",\"category_id\":5,\"color\":\"#3C565B\",\"text\":\"Mental Health\"},{\"id\":4,\"value\":\"Lifestyle\",\"icon\":\"diagram2-fill\",\"category_id\":5,\"color\":\"#3C565B\",\"text\":\"Lifestyle\"}]',235,NULL,NULL,NULL,1,'2021-08-16 13:50:15','2021-08-16 13:50:15','{\"value\":\"Wellness\",\"icon\":\"shuffle\",\"id\":5,\"color\":\"#8B008B\",\"image\":\"\\/img\\/five.png\"}',NULL),
	(55,'One thing I wish somebody told me about motherhood.','public','user','I had a lonely pregnancy, no thanks to the pandemic, but I am determined to go the rest of the way with a strong community of mums, sharing and gaining as much practical insight as possible.\nIf we all dropped one (or more) gem we wish we knew about motherhood, perhaps someone would be blessed by it. \n\nLet\'s go mamas! \n\nP.S. Welcome to my mum tribe.','[{\"id\":2,\"value\":\"Mental Health\",\"icon\":\"diagram2-fill\",\"category_id\":5,\"color\":\"#3C565B\",\"text\":\"Mental Health\"},{\"id\":4,\"value\":\"Lifestyle\",\"icon\":\"diagram2-fill\",\"category_id\":5,\"color\":\"#3C565B\",\"text\":\"Lifestyle\"}]',235,NULL,NULL,NULL,1,'2021-08-19 11:38:10','2021-08-19 11:38:10','{\"value\":\"Wellness\",\"icon\":\"shuffle\",\"id\":5,\"color\":\"#8B008B\",\"image\":\"\\/img\\/five.png\"}',NULL),
	(65,'Home workout Vs Gym workout','public','user','Which one is most effective — working out at home or at the gym?','[{\"value\":\"Productivity\",\"color\":\"#191970\",\"text\":\"Productivity\",\"icon\":\"collection-fill\"},{\"value\":\"Mental health\",\"color\":\"#3C565B\",\"text\":\"Mental health\",\"icon\":\"diagram2-fill\"},{\"value\":\"Personal Development\",\"color\":\"#307D7E\",\"text\":\"Personal Development\",\"icon\":\"flower2\"},{\"value\":\"Sports\",\"color\":\"#728C00\",\"text\":\"Sports\",\"icon\":\"globe\"},{\"value\":\"Creativity\",\"color\":\"#254117\",\"text\":\"Creativity\",\"icon\":\"upc-scan\"},{\"value\":\"Fitness\",\"color\":\"#6D7B8D\",\"text\":\"Fitness\",\"icon\":\"life-preserver\"},{\"value\":\"Wellness\",\"color\":\"#8B008B\",\"text\":\"Wellness\",\"icon\":\"shuffle\"},{\"value\":\"Leisure\",\"color\":\"#0000A5\",\"text\":\"Leisure\",\"icon\":\"slash-circle\"}]',625,NULL,NULL,NULL,1,'2021-08-19 15:59:13','2021-08-19 15:59:13','{\"value\":\"Wellness\",\"icon\":\"shuffle\",\"id\":5,\"color\":\"#8B008B\",\"image\":\"\\/img\\/five.png\"}',NULL),
	(75,'Cancel culture','public','user','Why are people so quick to cancel celebrities and influencers over things that they do themselves? We need to stop holding them to extreme standards and expectations because they’re still humans ??‍♀️','[{\"id\":4,\"value\":\"Pop Culture\",\"icon\":\"speaker-fill\",\"category_id\":6,\"color\":\"#7ecc00\",\"text\":\"Pop Culture\"}]',515,NULL,NULL,NULL,1,'2021-08-21 20:10:00','2021-08-21 20:10:00','{\"value\":\"Entertainment\",\"icon\":\"speaker\",\"id\":6,\"color\":\"#C32148\",\"image\":\"\\/img\\/seven.png\"}',NULL),
	(85,'Where to meet tech bros in Lagos','public','user','Do they actually come out to interact with mere mortals or are they usually holed up in dingy rooms, buried in their code? Hehe!','[{\"id\":2,\"value\":\"Programming\",\"icon\":\"cpu\",\"category_id\":3,\"color\":\"#347C2C\",\"text\":\"Programming\"},{\"id\":3,\"value\":\"Design\",\"icon\":\"collection-fill\",\"category_id\":3,\"color\":\"#191970\",\"text\":\"Design\"},{\"id\":1,\"value\":\"Start Up\",\"icon\":\"server\",\"category_id\":3,\"color\":\"#0020C2\",\"text\":\"Start Up\"}]',235,NULL,NULL,NULL,1,'2021-08-26 10:20:50','2021-08-26 10:20:50','{\"value\":\"Technology\",\"icon\":\"cpu\",\"id\":3,\"color\":\"#347C2C\",\"image\":\"\\/img\\/six.png\"}',45),
	(95,'Roadmap to becoming a Web Developer','public','user','Over the years I have had friends disturbing me to help them learn to code and even after I give them directions it still always becomes a herculean task and they end up losing interest. So today I will be breaking it down step by step, follow along guys.','[{\"id\":2,\"value\":\"Programming\",\"icon\":\"cpu\",\"category_id\":3,\"color\":\"#347C2C\",\"text\":\"Programming\"}]',305,NULL,NULL,NULL,1,'2021-09-06 09:16:19','2021-09-06 09:16:19','{\"value\":\"Technology\",\"icon\":\"cpu\",\"id\":3,\"color\":\"#347C2C\",\"image\":\"\\/img\\/six.png\"}',45);
