	(274,'Your situation analysis (SWOT)','[{\"show\":true,\"title\":\"Your SWOT analysis\",\"overview\":\"SWOT Analysis\\u00a0is the most renowned tool for audit and analysis of the overall strategic position of the business and its environment. Its key purpose is to identify the strategies that will best align an organization\\u2019s resources and capabilities to the requirements of the environment in which it operates.\",\"file_type\":\"worksheet\",\"file\":null,\"template\":{\"id\":394,\"sections\":\"[{\\\"title\\\":\\\"SWOT Analysis\\\",\\\"description\\\":\\\"<p>SWOT Analysis is the most renowned tool for audit and analysis of the overall strategic position of the business and its environment. Its key purpose is to identify the strategies that will best align an organization&rsquo;s resources and capabilities to the requirements of the&nbsp;environment in which it operates.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>SWOT Analysis<\\\\\\/strong>&nbsp;is the most renowned tool for audit and analysis of the overall strategic position of the business and its environment. Its key purpose is to identify the strategies that will best align an organization&rsquo;s resources and capabilities to the requirements of the environment in which it operates.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Here&rsquo;s a quick break down of SWOT:<\\\\\\/p>\\\\n<p class=\\\\\\\"p3\\\\\\\">&nbsp;<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Strengths<\\\\\\/strong> are the qualities that enable us to accomplish the organization&rsquo;s mission. These are what you are well versed in or what you have expertise in, the traits and qualities your employees possess (individually and as a team) and the distinct features that give your organization its consistency.<\\\\\\/p>\\\\n<p class=\\\\\\\"p2\\\\\\\">&nbsp;<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Weaknesses<\\\\\\/strong> are the qualities that prevent us from accomplishing our mission and achieving our full potential. They are the factors that do not meet the standards we feel they should meet.<\\\\\\/p>\\\\n<p class=\\\\\\\"p3\\\\\\\">&nbsp;<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Opportunities<\\\\\\/strong> are presented by the environment within which our organization operates. Organizations can gain competitive advantage by making use of opportunities.<\\\\\\/p>\\\\n<p class=\\\\\\\"p2\\\\\\\">&nbsp;<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Threats <\\\\\\/strong>arise when conditions in external environment jeopardize the reliability and profitability of the organization&rsquo;s business. They compound the vulnerability when they relate to the weaknesses.<\\\\\\/p>\\\",\\\"showSection\\\":true,\\\"questions\\\":[{\\\"fixed\\\":false,\\\"showQuestion\\\":true,\\\"question\\\":\\\"Top 5 strengths of my business:\\\",\\\"addSubQuestion\\\":false,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":null,\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"short\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":\\\"What you are well-versed or have expertise in\\\",\\\"score\\\":0},{\\\"fixed\\\":false,\\\"showQuestion\\\":false,\\\"question\\\":\\\"Top 5 weaknesses of my business:\\\",\\\"addSubQuestion\\\":false,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":null,\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"short\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":\\\"Qualities that prevent your business from accomplishing its mission and achieving its full potential.\\\",\\\"score\\\":0},{\\\"fixed\\\":false,\\\"showQuestion\\\":false,\\\"question\\\":\\\"Top 5 opportunities for my business:\\\",\\\"addSubQuestion\\\":false,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":null,\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"short\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":\\\"Presented by the environment within which your business operates\\\",\\\"score\\\":0},{\\\"fixed\\\":false,\\\"showQuestion\\\":true,\\\"question\\\":\\\"Top 5 threats to my business:\\\",\\\"addSubQuestion\\\":false,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":null,\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"short\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":\\\"Conditions in external environment that jeopardize the reliability and profitability of your business.\\\",\\\"score\\\":0}]}]\",\"interest\":null,\"title\":\"Your Situation Analysis (SWOT)\",\"organization_id\":74,\"created_at\":\"2021-07-29T00:59:20.000000Z\",\"updated_at\":\"2021-07-29T10:47:58.000000Z\",\"type\":\"worksheet\",\"status\":\"active\",\"user_id\":null,\"admin_id\":null,\"facilitator_id\":44,\"totalscore\":null,\"options\":\"{\\\"grading\\\":false,\\\"correct_answer\\\":false,\\\"time\\\":false}\",\"duration\":null},\"templates\":[],\"type\":\"worksheet\"}]',394,44,74,'2021-07-29 10:57:42','2021-07-29 10:57:42',NULL),
	(284,'Your industry analysis (Competitor)','[{\"show\":true,\"title\":\"Your industry analysis\",\"overview\":\"There are essentially two ways you can identify competitors. The first is to look at the market from the customer\'s viewpoint and group all your competitors by the degree to which they contend for the buyer\'s money. The second method is to group competitors according to their various competitive strategies so you understand what motivates them.\\nFind out which option serves you better.\",\"file_type\":\"worksheet\",\"file\":null,\"template\":{\"id\":404,\"sections\":\"[{\\\"title\\\":\\\"Analyzing your industry\\\",\\\"description\\\":\\\"<p class=\\\\\\\"p1\\\\\\\">The purpose of the competitive analysis is to determine the strengths and weaknesses of the competitors within your market, then based on that develop strategies that will provide you with a distinct advantage, and barriers that prevent potential competition from entering your market.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">The first step in a competitor analysis is to identify the current and potential competition. There are essentially two ways you can identify competitors. The first is to look at the market from the customer\'s viewpoint and group all your competitors by the degree to which they contend for the buyer\'s money. The second method is to group competitors according to their various competitive strategies so you understand what motivates them. Being a strategist, I tend to use the second option more.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Once you have grouped your competitors, you can start to analyze their strategies and identify the areas where they are most vulnerable. This can be done through an examination of your competitors\' weaknesses and strengths.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Please note that competition comes in several forms:<\\\\\\/strong><\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Direct competitors:<\\\\\\/strong> The ones who keep you up at night. They resemble your company; close to customers, ambitious and trying to reach the same target market. You better keep an eye on these guys.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Online Competitors: <\\\\\\/strong>Reality check, your competitor isn&rsquo;t just on the next block or even within your state. You could find yourself battling it out for customers with someone from the other side of the world. Please take these online competitors very, very seriously.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>The big guys:<\\\\\\/strong> Nestle, Dangote, PZ and national franchises with huge marketing budgets. Don&rsquo;t just dismiss these as being no issue&mdash; a lot of them have adopted customer service practices that used to be the hallmark of small business. These are very real competitors to you, especially if you plan to compete on the basis of price.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Alternatives: <\\\\\\/strong>When thinking about competition, you must also<span class=\\\\\\\"Apple-converted-space\\\\\\\">&nbsp; <\\\\\\/span>consider all other ways the customer can spend their time and money. I mean, a customer can choose to go on vacation rather than buy your hair, right? You get the gist. hehe<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Inertia Factors: <\\\\\\/strong>Your customers can simply decide not to spend their money on anything at all, and this will not be due to your product not being valuable. During tough economic periods, it can be difficult to persuade people to part with their hard earned cash.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Potential future competitors: <\\\\\\/strong>There are competitors you will face tomorrow, and these might differ from what you expect. I bet you this COVID-19 pandemic many businesses were finally faced with competition from the most unlikely places. Keep your eyes open, competition can emerge from the unlikeliest places.<\\\\\\/p>\\\",\\\"showSection\\\":true,\\\"questions\\\":[{\\\"fixed\\\":false,\\\"showQuestion\\\":true,\\\"question\\\":\\\"Competitor Analysis:\\\",\\\"addSubQuestion\\\":true,\\\"subQuestion\\\":[{\\\"show\\\":false,\\\"question\\\":\\\"My top 5 competitors:\\\",\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null},{\\\"show\\\":true,\\\"question\\\":\\\"Top 5 similarities:\\\",\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null},{\\\"show\\\":false,\\\"question\\\":\\\"What can I learn from them?\\\",\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null},{\\\"show\\\":true,\\\"question\\\":\\\"How can I differentiate from them?\\\",\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null},{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"answer\\\":null,\\\"answers\\\":[],\\\"response\\\":null,\\\"responses\\\":[],\\\"response_count\\\":null}],\\\"response\\\":null,\\\"responses\\\":[],\\\"result\\\":null,\\\"type\\\":\\\"long\\\",\\\"limit\\\":2,\\\"options\\\":[{\\\"value\\\":null}],\\\"showAnswer\\\":false,\\\"answer\\\":null,\\\"answers\\\":[],\\\"placeholders\\\":[{\\\"placeholder\\\":null,\\\"response\\\":null}],\\\"placeholder\\\":null,\\\"hint\\\":\\\"Note that competition comes in several forms: direct, online, the big guys, alternatives, potential competitors etc.\\\",\\\"score\\\":0}]}]\",\"interest\":null,\"title\":\"Your Industry Analysis\",\"organization_id\":74,\"created_at\":\"2021-07-29T01:09:35.000000Z\",\"updated_at\":\"2021-07-29T10:48:20.000000Z\",\"type\":\"worksheet\",\"status\":\"active\",\"user_id\":null,\"admin_id\":null,\"facilitator_id\":44,\"totalscore\":null,\"options\":\"{\\\"grading\\\":false,\\\"correct_answer\\\":false,\\\"time\\\":false}\",\"duration\":null},\"templates\":[],\"type\":\"worksheet\"}]',394,44,74,'2021-07-29 11:00:13','2021-07-29 11:00:13',NULL),
	(294,'Defining your market goals','[{\"show\":true,\"title\":\"Your marketing goals\",\"overview\":\"This is where you paint your picture of the future: What marketing objectives do you want to achieve over the course of the plan? Better to motivate yourself with ambitious but worthy targets than to depress yourself by failing at too many enthusiastic goals.\",\"file_type\":\"worksheet\",\"file\":null,\"template\":{\"id\":414,\"sections\":\"[{\\\"title\\\":\\\"Setting your marketing goals\\\",\\\"description\\\":\\\"<p class=\\\\\\\"p1\\\\\\\">This is where you paint your picture of the future: What marketing objectives do you want to achieve over the course of the plan? Each of your marketing objectives should include both a narrative description of what you intend to accomplish along with numbers to give you something concrete to aim for.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Just to say you want to make a first entry into the tailoring materials marketplace isn\'t providing much guidance. Saying you want to go from 0 percent to 8 percent of the local market in two years is easier to understand and verifiable. If you\'re not sure of the size of the local market, then aim at setting a figure in sales e.g. I want to sell N50,000 worth of goods every week.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">You should make it a point to limit the number of marketing objectives you take on in a given year. Let\'s face it, change can bring stress, disorient staff and sometimes even confuse your target market. Keep your objectives challenging but achievable. Better to motivate yourself with ambitious but worthy targets than to depress yourself by failing at too many enthusiastic goals.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\">Here are some typical marketing objective categories:<\\\\\\/p>\\\\n<ul class=\\\\\\\"ul1\\\\\\\">\\\\n<li class=\\\\\\\"li1\\\\\\\">Introduce new products<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Extend or regain market for existing product<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Enter new territories for the company<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Boost sales in a particular product, market or price range. Where will this business come from? Be specific.<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Cross-sell (or bundle) one product with another<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Enter into long-term contracts with desirable clients<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Raise prices without cutting into sales figures<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Refine a product<\\\\\\/li>\\\\n<li class=\\\\\\\"li1\\\\\\\">Enhance manufacturing\\\\\\/product delivery<\\\\\\/li>\\\\n<\\\\\\/ul>\\\\n<p class=\\\\\\\"p1\\\\\\\">You get the idea. If your objective is to build a business in Kaduna, you have to put together concrete goals to make it happen. Each of these actions makes sense. You might come up with others (there\'s no limit to human creativity, after all, especially in marketing). The point is that each goal should consist of concrete actions.<\\\\\\/p>\\\\n<p class=\\\\\\\"p1\\\\\\\"><strong>Don&rsquo;t forget your budgets and controls; <\\\\\\/strong>whether done well or poorly, business activity always costs money. Your marketing plan needs to have a section in which you allocate budgets for each activity planned. However, do not rely on financial goals alone, since in most cases, there is a delayed reaction to worsening figures. Goals relating to your market and customers (e.g. decreasing customer satisfaction) are often early indicators of a change.<\\\\\\/p>\\\\n<p class=\\\\\\\"p3\\\\\\\">&nbsp;<\\\\\\/p>\\\",\\\"showSection\\\":true,\\\"questions\\\":[{\\\"fixed\\\":false,\\\"showQuestion\\\":true,\\\"question\\\":\\\"My marketing goals:\\\",\\\"addSubQuestion\\\":true,\\\"subQuestion\\\":[{\\\"show\\\":true,\\\"question\\\":\\\"Short Term:\\\",\\\"placeholders\\\":[{\\\"placeholder\\\":\\\"Financial goal\\\",\\\"response\\\":null},{\\\"placeholder\\\":\\\