	(354,'[{\"title\":\"My ideal customer\",\"description\":\"<div class=\\\"page\\\" title=\\\"Page 15\\\">\\n<div class=\\\"layoutArea\\\">\\n<div class=\\\"column\\\">\\n<p style=\\\"text-align: center;\\\"><em>&ldquo;Want to know one sure way to fail in small business? Try to sell to everyone!&ldquo; <\\/em><\\/p>\\n<p>A key to small business success is carving out a niche, rather than competing for every customer, small businesses just don&rsquo;t have the resources of time or money to be generalist.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\",\"showSection\":true,\"questions\":[{\"fixed\":false,\"showQuestion\":true,\"question\":\"My ideal customers are:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"short\",\"limit\":2,\"options\":[{\"value\":null}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"placeholder\":null,\"hint\":\"e.g. Men, Women, Girls, Boys, Toddlers, Babies etc.\",\"score\":0},{\"fixed\":false,\"showQuestion\":true,\"question\":\"My customer falls within the following age range:\",\"addSubQuestion\":false,\"subQuestion\":[{\"show\":true,\"question\":null,\"placeholders\":[{\"placeholder\":null,\"response\":null}],\"limit\":2,\"options\":[{\"value\":null}],\"answer\":null,\"answers\":[],\"response\":null,\"responses\":[],\"response_count\":null}],\"response\":null,\"responses\":[],\"result\":null,\"type\":\"dropdown\",\"limit\":2,\"options\":[{\"value\":\"< 5 Years\"},{\"value\":\"< 11 Years\"},{\"value\":\"12-17 Years\"},{\"value\":\"18-34 Years\"},{\"value\":\"35-50 Years\"},{\"value\":\"50-70 Years\"}],\"showAnswer\":false,\"answer\":null,\"answers\":[],\"placeholders\":[{\"placeholder\":null,\"respons